{{Infobox dungeon |name = Sendoff Spring |image = [[File:Sendoff_Spring.png|300px]] |caption = A map of Sendoff Spring. |tokens = 96,500 |location = East of Route 214. }} '''Sendoff Spring''' is a [[Dungeons|dungeon]] in [[Sinnoh]]. It initially has 64 tiles arranged in an 8x8 square, including 8 chest tiles, 19 non-boss encounter tiles, and 1 boss encounter tile. Wild Encounters have 2,603,000 HP.
